    false,nt"url": null,nt"notes": "This annual narrative report for Roanoke
    River NWR outlines activities and accomplishments during the 2004 calendar year.
    The report begins with an introduction to the Refuge. Highlights and weather conditions
    are summarized for the year. Information about monitoring and studies- including
    surveys and censuses and studies and investigations- is provided next. Habitat restoration
    and management projects are also covered; activities include wetland restoration,
    water level management, grazing/mowing/haying, and forest management. Fish and wildlife
    management are discussed next with emphasis on bird banding. Coordination activities,
    such as interagency coordination, private land activities, and cooperative organizations,
    are outlined. The resource protection section provides an update on law enforcement,
    wildfire preparedness, permits, contaminants, and land acquisition support. Information
    about public education and recreation is given including visitor services and outreach.
    Finally, comprehensive management planning and general administration are discussed
    in the Refuge planning and administration section.",nt"license_title": "License
